import {
  Container,
  createTheme,
  ThemeProvider,
  Grid,
  TextField,
  Typography,
  Button,
  Box,
} from "@mui/material";
import { useNavigate } from "react-router-dom";
import myIcon from "../Assets/icon.png";

const customTheme = createTheme({
  palette: {
    primary: { main: "#D6CC99" },
    secondary: { main: "#445D48" },
  },
});

const Header = () => {
  const navigate = useNavigate();

  const handleClickHome = async () => {
    navigate("/");
  };

  return (
    <ThemeProvider theme={customTheme}>
      <Container
        sx={{
          height: "10vh",
          minWidth: "100%",
        }}
      >
        <Grid
          container
          direction="row"
          justifyContent="right"
          alignItems="right"
          sx={{
            color: "white",
            height: "15vh",
          }}
        >
          <Grid
            item
            sx={{
              width: { xs: "200px", lg: "200px" },
              display: "flex",
              justifyContent: "space-evenly",
              alignItems: "center",
            }}
          >
            <Box
              component="img"
              sx={{
                height: "100px",
                width: "300px",
                maxHeight: { xs: "233px", md: "167px" },
                maxWidth: { xs: "350px", md: "250px" },
                backgroundImage: myIcon,
              }}
            />
          </Grid>
          <Grid
            item
            sx={{
              width: { xs: "200px", lg: "200px" },
              display: "flex",
              justifyContent: "space-evenly",
              alignItems: "center",
            }}
          >
            <Button onClick={() => handleClickHome()}>
              <Typography textTransform="none" color="primary" variant="h6">
                •{" "}
              </Typography>
              <Typography color="inherit" noWrap>
                &nbsp;
              </Typography>
              <Typography textTransform="none" color="secondary" variant="h6">
                Projects
              </Typography>
            </Button>
          </Grid>
          <Grid
            item
            sx={{
              width: { xs: "200px", lg: "200px" },
              display: "flex",
              justifyContent: "space-evenly",
              alignItems: "center",
            }}
          >
            <Button onClick={() => handleClickHome()}>
              <Typography textTransform="none" color="primary" variant="h6">
                •{" "}
              </Typography>
              <Typography color="inherit" noWrap>
                &nbsp;
              </Typography>
              <Typography textTransform="none" color="secondary" variant="h6">
                About Me
              </Typography>
            </Button>
          </Grid>
          <Grid
            item
            sx={{
              width: { xs: "200px", lg: "200px" },
              display: "flex",
              justifyContent: "space-evenly",
              alignItems: "center",
            }}
          >
            <Button onClick={() => handleClickHome()}>
              <Typography textTransform="none" color="primary" variant="h6">
                •{" "}
              </Typography>
              <Typography color="inherit" noWrap>
                &nbsp;
              </Typography>
              <Typography textTransform="none" color="secondary" variant="h6">
                Contact
              </Typography>
            </Button>
          </Grid>
          <Grid
            item
            sx={{
              width: { xs: "200px", lg: "200px" },
              display: "flex",
              justifyContent: "space-evenly",
              alignItems: "center",
            }}
          >
            <Button
              color="secondary"
              onClick={() => handleClickHome()}
              variant="outlined"
            >
              Resume
            </Button>
          </Grid>
        </Grid>
      </Container>
    </ThemeProvider>
  );
};

export default Header;
